import React from 'react';
import Octicon, { LogoGithub } from '@githubprimer/octicons-react';
import { TopBar, Paper } from '@../../../../reactify/build';

const Header = () => (
  <TopBar>
    <TopBar.Logo>
      <Paper success style={{ color: 'white', padding: '0.2em 0.4em', boxShadow: 'none' }} className="logo">reactify ui</Paper>
    </TopBar.Logo>
    <TopBar.Menu warning>
      <a href="https://github.com/asterisx/reactify">
        <Octicon icon={LogoGithub} size="large" ariaLabel="GitHub" />
      </a>
    </TopBar.Menu>
  </TopBar>
);
export default Header;
